import React from "react";

import styles from "./Header.module.css";
// Header Component
const Header = (props) => {
  return (
    <div className={styles.header}>
      <h1>ReactMeals</h1>
      <div className={styles.main-image}>
        <img src = './Assets/meals.jpg'></img>
      </div>
    </div>
  );
};

export default Header;
